import React, {useEffect, useState} from 'react'
import * as axios from 'axios'

export default function Github() {
    const [user, setUser] = useState({})

    useEffect(() => {
        axios.get('https://api.github.com/users/dvwhitem').then(res => setUser(res.data))
    }, [])

    return (
        <div>
            <h1>Github Info</h1>
        </div>
    )
}
